def icon_from_base64(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    icon = QIcon(pixmap)
    return icon


class UI(QMainWindow):
    """Summary of class here.

    This class is a base UI class. It provides the basic function selection interface,
    which is the base class of Charge class and Target class.

    Attributes:
        charge: A call charge query window.
        ticket: A call ticket query window.
        data: The file name of input data.
        saveas: The file name of output data.
    """
    def __init__(self):
        super().__init__()
        self.widgets()
        self.charge = None
        self.ticket = None

        self.data = 'data.xlsx'
        self.saveas = 'fy.xlsx'

        self.show()

    def widgets(self):
        """
        Main method, places the widgets etc in the window, also controls window size.
        """
        img_b64 = b''
        icon = icon_from_base64(img_b64)
        self.setWindowIcon(icon)
        self.setWindowTitle(u"模拟电信计费系统")
        self.setFixedSize(750, 450)
        # Adding the sub def for widgets etc
        self.add_menus_and_status()
        self.add_buttons()

    def add_menus_and_status(self):
        """
        Add menu bar.
        """
        self.statusBar().showMessage("")
        menubar = self.menuBar()
        menu = menubar.addMenu(u"菜单(Menu)")
        exit_action = QAction(u"退出", self)
        exit_action.setStatusTip(u"点击退出程序")
        exit_action.triggered.connect(self.close)
        exit_action.setShortcut(Qt.Key_Escape)
        menu.addAction(exit_action)

    def add_buttons(self):
        """
        Adding buttons and label to the window
        """
        font = QFont()
        font.setFamily(u"黑体")
        font.setPointSize(12)
        btn_charge = QPushButton(u"话费查询")
        btn_charge.setStatusTip(u"点击查询话费")
        btn_charge.setFixedHeight(50)
        btn_charge.setFont(font)
        btn_charge.clicked.connect(self.query_charge)
        btn_ticket = QPushButton(u"话单查询")
        btn_ticket.setStatusTip(u"点击查询话单")
        btn_ticket.setFixedHeight(50)
        btn_ticket.setFont(font)
        btn_ticket.clicked.connect(self.query_ticket)

        # Creating a label
        font = QFont()
        font.setFamily(u"微软雅黑")
        font.setPointSize(26)
        title = QLabel(u"模拟电信计费系统")
        title.setFont(font)
        title.setAlignment(Qt.AlignCenter)
        title.setObjectName("title")

        font = QFont()
        font.setFamily(u"黑体")
        font.setPointSize(18)
        welcome = QLabel(u"欢迎使用模拟电信计费系统！")
        welcome.setFont(font)
        welcome.setAlignment(Qt.AlignCenter)
        welcome.setObjectName("welcome")

        # Creating the grid to place buttons
        grid_layout = QGridLayout()
        # Placing the buttons within the grid
        grid_layout.addWidget(btn_charge, 2, 2, 1, 2)
        grid_layout.addWidget(btn_ticket, 2, 6, 1, 2)
        grid_layout.addWidget(title, 0, 1, 1, 8)
        grid_layout.setAlignment(title, Qt.AlignCenter)
        grid_layout.addWidget(welcome, 1, 1, 1, 8)
        grid_layout.setAlignment(welcome, Qt.AlignCenter)
        # Create QWidget object
        layout_widget = QWidget()
        layout_widget.setLayout(grid_layout)
        # Set the widget as central
        self.setCentralWidget(layout_widget)

    def query(self):
        """
        An unimplemented interface for subclasses to implement according to their own needs.
        """
        raise NotImplementedError("Not Implemented Error!")

    def query_charge(self):
        """
        Show the window of charge query.
        """
        self.charge = Charge()
        self.charge.show()

    def query_ticket(self):
        """
        Show the window of ticket query.
        """
        self.ticket = Ticket()
        self.ticket.show()

    def charging(self):
        """
        This method is used to calculate and generate expense files(fy.xlsx). Because reading and writing excel file
        will have some time cost, so only the implementation of the method is provided here. If you need to call, you
        need to instantiate an object of the class (including anonymous objects), and then call it again. In order to
        save time, this project uses the daemon thread to call.
        """
        hd = pyexcel.get_sheet(file_name=self.data, sheet_name='hd')
        # Take the first row of each sheet page as the column name (NECESSARY!!!)
        hd.name_columns_by_row(0)
        hd_dict = hd.to_dict()

        fl = pyexcel.get_sheet(file_name=self.data, sheet_name='fl')
        fl.name_columns_by_row(0)
        fl_dict = fl.to_dict()

        content = [[u'主叫电话号码', u'通话类型', u'话费金额']]

        for i in range(len(hd_dict[u'主叫电话号码'])):
            call_type = hd_dict[u'主叫区号'][i] == hd_dict[u'被叫区号'][i]
            if call_type:
                cost = 0.5 + (ceil(int(hd_dict[u'通话时长（秒）'][i]) / 180) - 1) * 0.2
            else:
                des = hd_dict[u'被叫区号'][i]
                try:
                    cost = float(fl_dict[u'费率'][fl_dict[u'区号'].index(des)]) *\
                           ceil(int(hd_dict[u'通话时长（秒）'][i]) / 60)
                except ValueError:
                    cost = 0.0
            content.append([str(hd_dict[u'主叫电话号码'][i]), u"本地通话" if call_type else u"长途通话", str(cost)])
        book = pyexcel.get_book(bookdict={'fy': content})
        book.save_as(self.saveas)


class Charge(UI):
    """
    Summary of class here.

    This class inherits from the UI class and provides the interface of the call charge query. The function includes
    inputting the phone number, clicking the "Confirm" button and displaying the relevant information in the table
    area below. The specific attributes are generated by QT Designer and will not be introduced.
    """
    def __init__(self):
        super().__init__()
        self.resize(668, 600)
        self.centralwidget = QWidget(self)
        self.centralwidget.setObjectName("centralwidget")
        self.gridLayout = QGridLayout(self.centralwidget)
        self.gridLayout.setObjectName("gridLayout")
        self.tip = QLabel(self.centralwidget)
        font = QFont()
        font.setFamily(u"黑体")
        font.setPointSize(16)
        self.tip.setFont(font)
        self.tip.setObjectName("tip")
        self.gridLayout.addWidget(self.tip, 0, 0, 1, 3)
        self.input_phone = QLineEdit(self.centralwidget)
        font = QFont()
        font.setFamily("Consolas")
        font.setPointSize(16)
        self.input_phone.setFont(font)
        self.input_phone.setObjectName("input_phone")
        self.gridLayout.addWidget(self.input_phone, 0, 3, 1, 4)
        self.btn_confirm = QPushButton(self.centralwidget)
        font = QFont()
        font.setFamily(u"黑体")
        font.setPointSize(12)
        self.btn_confirm.setFont(font)
        self.btn_confirm.setObjectName("btn_confirm")
        self.btn_confirm.setFixedHeight(35)
        self.gridLayout.addWidget(self.btn_confirm, 1, 6, 1, 1)
        self.table = QTableWidget(self.centralwidget)
        self.table.setObjectName("tableWidget")
        self.table.setColumnCount(5)
        item = QTableWidgetItem()
        self.table.setHorizontalHeaderItem(0, item)
        item = QTableWidgetItem()
        self.table.setHorizontalHeaderItem(1, item)
        item = QTableWidgetItem()
        self.table.setHorizontalHeaderItem(2, item)
        item = QTableWidgetItem()
        self.table.setHorizontalHeaderItem(3, item)
        item = QTableWidgetItem()
        self.table.setHorizontalHeaderItem(4, item)
        self.gridLayout.addWidget(self.table, 2, 0, 1, 7)
        self.setCentralWidget(self.centralwidget)

        self.tip.setText(u"请输入要查询的手机号：")
        self.btn_confirm.setText(u"确  定")
        item = self.table.horizontalHeaderItem(0)
        item.setText(u"用户名")
        item = self.table.horizontalHeaderItem(1)
        item.setText(u"电话号码")
        item = self.table.horizontalHeaderItem(2)
        item.setText(u"本地话费")
        item = self.table.horizontalHeaderItem(3)
        item.setText(u"长途话费")
        item = self.table.horizontalHeaderItem(4)
        item.setText(u"话费总计")
        QMetaObject.connectSlotsByName(self)

        font = QFont(u'微软雅黑', 11)
        font.setBold(True)
        self.table.horizontalHeader().setFont(font)
        self.table.setColumnWidth(0, 132)
        self.table.setColumnWidth(1, 200)
        self.table.horizontalHeader().setStyleSheet('QHeaderView::section{background:lightgray}')
        self.table.setEditTriggers(QAbstractItemView.NoEditTriggers)

        self.btn_confirm.clicked.connect(self.query)

    def query(self):
        """
        Query the charge and show it in the table area.
        """
        phone_number = self.input_phone.text()
        if not phone_number.isdigit():
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"错误", u"请输入正确的电话号码！", QMessageBox.Cancel)
            return

        # get name
        yh = pyexcel.get_sheet(file_name=self.data, sheet_name='yh')
        yh.name_columns_by_row(0)
        yh_dict = yh.to_dict()
        try:
            name = yh_dict[u'用户姓名'][yh_dict[u'电话号码'].index(int(phone_number))]
        except ValueError:
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"错误", u"系统未查找到对应的账户信息！\n请仔细检查输入！", QMessageBox.Cancel)
            return

        row = self.table.rowCount()
        self.table.setRowCount(row + 1)

        while not os.path.isfile("fy.xlsx"):
            time.sleep(0.1)

        fy = pyexcel.get_sheet(file_name='fy.xlsx', sheet_name='fy')
        fy.name_columns_by_row(0)
        fy_dict = fy.to_dict()
        local, toll = 0.0, 0.0
        for i in range(len(fy_dict[u'主叫电话号码'])):
            if str(fy_dict[u'主叫电话号码'][i]) == phone_number:
                if fy_dict[u'通话类型'][i] == u'本地通话':
                    local += float(fy_dict[u'话费金额'][i])
                else:
                    toll += float(fy_dict[u'话费金额'][i])

        self.table.setItem(row, 0, QTableWidgetItem(name))
        self.table.setItem(row, 1, QTableWidgetItem(phone_number))
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, local)  # it will set integer instead of string
        self.table.setItem(row, 2, item)
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, toll)
        self.table.setItem(row, 3, item)
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, local + toll)
        self.table.setItem(row, 4, item)
        for y in range(5):
            item = self.table.item(row, y)
            item.setTextAlignment(Qt.AlignCenter)


